DECLARE @account AS  TABLE(CodeM CHAR(6), Account varchar(15))
INSERT @account VALUES('551001','34001-90-2S'),('441001','34001-25560-2S')


SELECT a.rf_idSMO,f.CodeM,l.NAMES,f.DateRegistration,a.Account, a.DateRegister AS DateAccount,c.idRecordCase,c.AmountPayment, ps.Price		
FROM dbo.t_File f INNER JOIN dbo.t_RegistersAccounts a ON
			f.id=a.rf_idFiles
			AND a.rf_idSMO<>'34'
			AND a.Letter<>'N'
					INNER JOIN dbo.t_RecordCasePatient r ON
			a.id=r.rf_idRegistersAccounts
					INNER JOIN dbo.t_Case c ON
			r.id=c.rf_idRecordCasePatient
					INNER JOIN dbo.t_MES m ON
			c.id=m.rf_idCase
					INNER JOIN #PriceMU ps ON
			m.MES=ps.MU   
					INNER JOIN dbo.vw_sprT001 l ON
			f.CodeM=l.CodeM               
WHERE c.rf_idV006=1 AND f.DateRegistration>'20151207' AND f.DateRegistration<@dateEnd AND a.ReportMonth=11 AND a.ReportYear=2015 	
		AND NOT EXISTS (SELECT * FROM @account WHERE CodeM=f.CodeM AND Account=a.Account)
ORDER BY f.CodeM

GO
